import logo from './logo.svg';
import './App.css';
import toDoList from './component/toDoList';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
      <toDoList/>
    </div>
  );
}

export default App;
